import React from 'react';
import { Link } from 'react-router-dom';


const Navbar: React.FC = () => {
  return (
    <nav>
        <div className='navbar-container'>
            <Link to='/'></Link>

            <ul className="menu menu-horizontal bg-base-100 rounded-box">
                <li><a>Item 1</a></li>
                <li><a>Item 2</a></li>
                <li><a>Item 3</a></li>
            </ul>
        </div>
    </nav>
  );
}

export default Navbar;
